import { useNavigate } from 'react-router-dom'
import '../groceryCard.css'

export const GroceryCard = ({ name, date_created, tags, listId, onDelete }) => {
    const navigate = useNavigate()
    return (
        <div className='groceryCard' type='submit' to='/create_list' onClick={() => {navigate(`/create_list_detail?id=${listId}`)}}>
            <div>
                <i className='fas fa-times-circle fa-3x' onClick={() => {onDelete(listId)}}></i>
                <h2> {name}</h2>
                <p>{date_created} </p>
            </div>
        </div>
    )}
